import React from "react";

//Style
import style from '../styles/loginManager/loginManager.css';

//Images
import customerManagerText from '../images/1x/customerManagerText.png'
import customerManagerText2x from '../images/2x/customerManagerText@2x.png' 
import customerManagerText3x from '../images/3x/customerManagerText@3x.png'

function LoginManager() {
  return (

    <div className="login-manager-container">


      <div className="background-container">

          <div className="background-text">

              <div className="images">

                <img className="customer-manager-text" srcSet={`${customerManagerText} 1x, ${customerManagerText2x} 2x, ${customerManagerText3x} 3x`} src={customerManagerText} alt="customerManagerText"/>
                <img className="customer-manager-text" srcSet={`${customerManagerText} 1x, ${customerManagerText2x} 2x, ${customerManagerText3x} 3x`} src={customerManagerText} alt="customerManagerText"/>
                <img className="customer-manager-text" srcSet={`${customerManagerText} 1x, ${customerManagerText2x} 2x, ${customerManagerText3x} 3x`} src={customerManagerText} alt="customerManagerText"/>
                <img className="customer-manager-text" srcSet={`${customerManagerText} 1x, ${customerManagerText2x} 2x, ${customerManagerText3x} 3x`} src={customerManagerText} alt="customerManagerText"/>

              </div>
              
              <h2 className="subtitle">customer Manager</h2>

          </div>
      
      </div>


    </div>
  );
}

export { LoginManager  };
